exports.$menus = {
    $layout: {
        $items: [{
            $bind: "$isSelected"
        }, {
            $layoutType: "row",
            $items: [{
                $title: "update Title",
                $layout: {
                    $items: [{
                        $bind: "upadateTitleArray"
                    }, {
                        $bind: "upadateTitleColumns"
                    }]
                }
            }, {
                $title: "show /hide",
                $layout: {
                    $items: [{
                        $bind: "hidexarray"
                    }, {
                        $bind: "showxarray"
                    }, {
                        $bind: "hidecolumn"
                    }, {
                        $bind: "showcolumn"
                    }]
                }
            }]
        }, {
            $layoutType: "row",
            $items: [{
                $title: "$isRedOnly",
                $layout: {
                    $items: [{
                        $bind: "$isRedOnlyallarray"
                    }, {
                        $bind: "$isRedOnlycolumn"
                    }, {
                        $bind: "$isRedOnlyrecord"
                    }, {
                        $bind: "$isRedOnlyrecords"
                    }]
                }
            }, {
                $title: "$isDisabled",
                $layout: {
                    $items: [{
                        $bind: "$isDisabledarray"
                    }, {
                        $bind: "$isDisabledcolumn"
                    }, {
                        $bind: "$isDisabledrecord"
                    }, {
                        $bind: "$isDisabledrecords"
                    }]
                }
            }]
        }, {
            $title: "styles",
            $layout: {
                $items: [{
                    $bind: "$fieldStylecolumn"
                }, {
                    $bind: "$fieldStylerecords"
                }, {
                    $bind: "$valueStyle"
                }]
            }
        }, {
            $layoutType: "row",
            $items: [{
                $title: "CRUD",
                $layout: {
                    $items: [{
                        $bind: "insert"
                    }, {
                        $bind: "updaterecord"
                    }, {
                        $bind: "updaterecords"
                    }, {
                        $bind: "reorder"
                    }, {
                        $bind: "deleterecord"
                    }, {
                        $bind: "deleterecords"
                    }]
                }
            }, {
                $title: "diagnoses",
                $layout: {
                    $items: [{
                        $bind: "singlediagnose"
                    }, {
                        $bind: "multidiagnoses"
                    }]
                }
            }]
        }, {
            $title: "actionlinks",
            $layout: {
                $layoutType: "row",
                $items: [{
                    $bind: "$linksnull"
                }, {
                    $bind: "$linkslazyload"
                }, {
                    $bind: "$links$actions"
                }]
            }
        }, {
            $title: "capabilities",
            $layout: {
                $items: [{
                    $bind: "capabilities"
                }, {
                    $bind: "capabilitiesinsertdel"
                }, {
                    $bind: "capabilitiesnone"
                }]
            }
        }]
    }
};

